import React, { useState, useEffect } from "react";
import "./Bookevent.css";
import Admin from "./Admin";
import axios from "axios";

function Bookevent() {
  const [categories, setCategories] = useState([]);
  const [categoryName, setCategoryName] = useState("");
  const [categoryImage, setCategoryImage] = useState(null);
  const [editMode, setEditMode] = useState(false);
  const [editCategoryId, setEditCategoryId] = useState(null);
  const [errorMessage, setErrorMessage] = useState("");
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    setLoading(true);
    const fetchCategories = async () => {
      try {
        const res = await axios.get(
          "http://localhost:3046/api/v1/admin/showcategory",
          {
            headers: {
              // Add any necessary headers here
            },
          }
        );
        setCategories(res.data);
      } catch (error) {
        setErrorMessage("Failed to fetch categories");
      } finally {
        setLoading(false);
      }
    };

    fetchCategories(); // Call the fetchCategories function
  }, []);

  return (
    <>
    <Admin />
      <div className="userlist">
        <div className="colorwhite">
          <div className="addevent text-center bg-white text-black">
            <h3 className="pt-3">{editMode ? "Edit Category" : "Post Category"}</h3>
            {errorMessage && <p className="text-danger">{errorMessage}</p>}
            {loading && <p>Loading...</p>}
            <form className="eventforms" onSubmit={handleSubmit}>
              <div className="col-sm-6 mx-auto">
                <div className="mb-3">
                  <input
                    className="form-control"
                    type="file"
                    onChange={handleImageChange}
                  />
                </div>
                <div className="col mb-3">
                  <input
                    type="text"
                    className="form-control"
                    placeholder="Category Name*"
                    value={categoryName}
                    onChange={handleNameChange}
                  />
                </div>
                <button
                  type="submit"
                  className="btn btn-primary form-control mb-5"
                >
                  {editMode ? "UPDATE" : "POST"}
                </button>
              </div>
            </form>

            <table className="alluser bg-white text-black">
              <thead>
                <tr className="userheader">
                  <th>No</th>
                  <th>Profile</th>
                  <th>Name</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {categories.map((category, index) => (
                  <tr key={category._id}>
                    <td>{index + 1}</td>
                    <td className="icon">
                      <img
                        className="adminicon"
                        src={category.URL}
                        alt={category.category_name}
                      />
                    </td>
                    <td>{category.category_name}</td>
                    <td>
                      <button
                        className="categoryicon"
                        onClick={() => handleEdit(category)}
                      >
                        <i className="fa fa-fw fa-pencil"></i>
                      </button>
                      <button
                        className="categoryicon"
                        onClick={() => handleDelete(category._id)}
                      >
                        <i className="fa fa-fw fa-trash"></i>
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </>
  );
}

export default Bookevent;
